import './FeaturedMovie.css';

export default ({item}) => {
    return (
        <section className="featured" style={{
            backgroundSize: 'cover',
            backgroundPosition: 'center',
            backgroundImage: `url(https:)`
        }}>
            <div>{item.original_name}</div>
        </section>
    );
}
